import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import firebase from 'firebase';
import { Provider } from 'react-redux';
import store from './store';


// Your web app's Firebase configuration
const firebaseConfig = {
  apiKey: "AIzaSyCOm-Ba6akJscOd5n372XlEHK3vnf47sZE",
  authDomain: "facebookproject-20706.firebaseapp.com",
  projectId: "facebookproject-20706",
  storageBucket: "facebookproject-20706.appspot.com",
  messagingSenderId: "663975603359",
  appId: "1:663975603359:web:c9b3a7b58696ef623246aa",
  measurementId: "G-VM5YY2N9HW"
};


firebase.initializeApp(firebaseConfig);

window.store = store;

ReactDOM.render(
  <Provider store={store}>
    <React.StrictMode>
      <App />
    </React.StrictMode>
  </Provider>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
